    return (
        <Box
            backgroundColor='white'
            minHeight='120px'
            padding={8}>
            <Text fontSize='2xl' fontWeight='bold'> {mainContent}</Text>
            <Text fontSize='xl'> {content}</Text>
        </Box>
    )
}

export default CardInfo;
